"use strict";(self.webpackChunkdocusaurus=self.webpackChunkdocusaurus||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"supporting-password-autofill-for-ios-appilcations","metadata":{"permalink":"/blog/supporting-password-autofill-for-ios-appilcations","source":"@site/blog/2022-08-23-supporting-password-autofill-for-ios-appilcations/index.md","title":"iOS \u5e94\u7528\u5b9e\u73b0\u5bc6\u7801\u81ea\u52a8\u586b\u5145","description":"\u4e86\u89e3\u5982\u4f55\u5728 SwiftUI \u548c UIKit \u5b9e\u73b0 Apple \u7684\u5bc6\u7801\u81ea\u52a8\u586b\u5145\u3002","date":"2022-08-23T00:00:00.000Z","formattedDate":"2022\u5e748\u670823\u65e5","tags":[{"label":"SwiftUI","permalink":"/blog/tags/swift-ui"},{"label":"\u5bc6\u7801","permalink":"/blog/tags/\u5bc6\u7801"},{"label":"UIKit","permalink":"/blog/tags/ui-kit"},{"label":"iOS","permalink":"/blog/tags/i-os"}],"readingTime":3.4,"hasTruncateMarker":false,"authors":[{"name":"GoSwiftUI","title":"goswiftui.com","url":"https://goswiftui.com","imageURL":"https://goswiftui.com/img/logo.png","key":"swift"}],"frontMatter":{"slug":"supporting-password-autofill-for-ios-appilcations","title":"iOS \u5e94\u7528\u5b9e\u73b0\u5bc6\u7801\u81ea\u52a8\u586b\u5145","authors":["swift"],"tags":["SwiftUI","\u5bc6\u7801","UIKit","iOS"]},"nextItem":{"title":"AppStore \u8d2d\u4e70\u6210\u529f\u540e\u9000\u6b3e\uff0c\u82f9\u679c\u662f\u5426\u4f1a\u4fdd\u7559\u4f63\u91d1\uff1f","permalink":"/blog/does-apple-keep-its-commission"}},"content":"## \u4e86\u89e3\u5982\u4f55\u5728 SwiftUI \u548c UIKit \u5b9e\u73b0 Apple \u7684\u5bc6\u7801\u81ea\u52a8\u586b\u5145\u3002\\n\\nApple \u7684\u5bc6\u7801\u81ea\u52a8\u586b\u5145\u529f\u80fd\u5141\u8bb8\u7528\u6237\u5728\u4e0d\u540c\u8bbe\u5907\u4e0a\u767b\u5f55\u540c\u4e00\u4e2a\u5e10\u6237\uff0c\u800c\u65e0\u9700\u8bb0\u4f4f\u4ed6\u4eec\u7684\u51ed\u636e\u3002\\n\\n\u4f8b\u5982\uff0c\u5728 Web \u5e94\u7528\u7a0b\u5e8f\u4e2d\u6ce8\u518c\u65f6\uff0c\u7528\u6237\u53ef\u4ee5\u751f\u6210\u5bc6\u7801\u5e76\u5c06\u51ed\u636e\u4fdd\u5b58\u5728\u4ed6\u4eec\u7684 iCloud \u94a5\u5319\u4e32\u4e2d\u3002\u5f53\u4ed6\u4eec\u5728\u67d0\u4e2a\u65f6\u5019\u8fd0\u884c\u672c\u673a\u5e94\u7528\u7a0b\u5e8f\u4ee5\u8bbf\u95ee\u540c\u4e00\u5e10\u6237\u65f6\uff0c\u8be5\u5e94\u7528\u7a0b\u5e8f\u4f1a\u5728\u5bc6\u7801 QuickType \u680f\u4e2d\u5efa\u8bae\u4e3a\u7f51\u7ad9\u5b58\u50a8\u7684\u51ed\u636e\u3002\u5728\u7528\u6237\u8fdb\u884c\u8eab\u4efd\u9a8c\u8bc1\u540e\uff0c\u5047\u8bbe\u4f7f\u7528 Face ID\uff0c\u7cfb\u7edf\u4f1a\u9884\u5148\u586b\u5199\u51ed\u636e - \u56e0\u6b64\u65e0\u9700\u91cd\u65b0\u8f93\u5165\u5b83\u4eec\u3002\\n\\n\u8981\u5728 iOS \u5e94\u7528\u7a0b\u5e8f\u4e2d\u6fc0\u6d3b\u5bc6\u7801\u81ea\u52a8\u586b\u5145\u529f\u80fd\uff0c\u9700\u8981\u6267\u884c\u4ee5\u4e0b\u6b65\u9aa4\uff1a\\n\\n1. \u8bbe\u7f6e\u5e94\u7528\u7a0b\u5e8f\u7684\u5173\u8054\u57df\u3002\\n2. \u5728\u76f8\u5173\u6587\u672c\u5b57\u6bb5\u4e0a\u8bbe\u7f6e\u6b63\u786e\u7684\u81ea\u52a8\u586b\u5145\u7c7b\u578b\u3002\\n\\n\u8ba9\u6211\u4eec\u66f4\u8be6\u7ec6\u5730\u770b\u4e00\u4e0b\u8fd9\u4e9b\u6b65\u9aa4\u3002\\n\\n### \u4e3a\u5171\u4eab Web \u51ed\u636e\u8bbe\u7f6e\u5e94\u7528\u7684\u5173\u8054\u57df\\n\\n\u5173\u8054\u57df\u5728\u7f51\u7ad9\u548c iOS \u5e94\u7528\u7a0b\u5e8f\u4e4b\u95f4\u5efa\u7acb\u5b89\u5168\u5173\u8054\u3002\u8981\u652f\u6301\u5171\u4eab Web \u51ed\u636e\uff0c\u9700\u8981\u6267\u884c\u4ee5\u4e0b\u6b65\u9aa4\uff1a\\n\\n1. \u4e3a\u5171\u4eab\u7684 Web \u51ed\u636e\u521b\u5efa\u548c\u914d\u7f6e\u5173\u8054\u7684\u57df\u6587\u4ef6\u3002\\n2. \u5c06\u5173\u8054\u7684\u57df\u6587\u4ef6\u6dfb\u52a0\u5230\u76f8\u5173\u7f51\u7ad9\u3002\\n3. \u5c06\u5173\u8054\u7684\u57df\u6743\u5229\u6dfb\u52a0\u5230 iOS \u5e94\u7528\u7a0b\u5e8f\u3002\\n\\n\u8fd9\u4e9b\u6b65\u9aa4\u4e2d\u7684\u6bcf\u4e00\u4e2a\u90fd\u5728[\u6709\u5173\u76f8\u5173\u57df\u6587\u4ef6](https://tanaschita.com/20220725-quick-guide-on-associated-domains-in-ios)\u7684\u8fd9\u7bc7\u6587\u7ae0\u4e2d\u8fdb\u884c\u4e86\u66f4\u8be6\u7ec6\u7684\u63cf\u8ff0\u3002\\n\\n### \u4f7f\u7528 textContentType \u542f\u7528\u5bc6\u7801\u81ea\u52a8\u586b\u5145\\n\\n\u8bbe\u7f6e\u5171\u4eab\u7f51\u7edc\u51ed\u636e\u540e\uff0c\u6211\u4eec\u9700\u8981\u505a\u7684\u5c31\u662f\u5728\u4efb\u4f55\u76f8\u5173\u8f93\u5165\u89c6\u56fe\u4e0a\u8bbe\u7f6e textContentType \u5c5e\u6027\u4ee5\u6fc0\u6d3b\u6b63\u786e\u7684\u81ea\u52a8\u586b\u5145\u5efa\u8bae\u3002\\n\\n\u4ee5\u4e0b UITextContentType \u503c\u53ef\u7528\uff1a\\n\\n- .username \u7528\u4e8e\u5e10\u6237\u540d\u79f0\\n- .password \u5bc6\u7801\\n- .newPassword \u7528\u4e8e\u65b0\u5bc6\u7801\\n- .oneTimeCode \u7528\u4e8e\u4e00\u6b21\u6027\u5bc6\u7801\uff0c\u4f8b\u5982\u81ea\u52a8\u5b8c\u6210\u5355\u56e0\u7d20\u77ed\u4fe1\u767b\u5f55\u6d41\u7a0b\u4e2d\u7684\u5b89\u5168\u4ee3\u7801\\n\\n\u8ba9\u6211\u4eec\u770b\u770b\u5982\u4f55\u4e3a SwiftUI \u548c UIKit \u5e94\u7528\u7a0b\u5e8f\u505a\u5230\u8fd9\u4e00\u70b9\u3002\\n\\n#### \u4e3a SwiftUI \u542f\u7528\u5bc6\u7801\u81ea\u52a8\u586b\u5145\\n\\n\u5728 SwiftUI \u4e2d\uff0c\u6211\u4eec\u53ef\u4ee5\u4f7f\u7528 textContentType(\\\\_:)\u65b9\u6cd5\u8bbe\u7f6e UITextContentType \u503c\uff1a\\n\\n```swift\\nTextField(\\"Enter your email\\", text: $emailAddress)\\n    .textContentType(.username)\\n    .keyboardType(.emailAddress)\\n\\n\\nTextField(\\"Enter your password\\", text: $password)\\n    .textContentType(.password)\\n```\\n\\n\u6839\u636e\u6211\u4eec\u63d0\u4f9b\u7684 textContentType\uff0ciOS \u4f1a\u81ea\u52a8\u9009\u62e9\u4e00\u4e2a\u5339\u914d\u7684\u952e\u76d8\u6765\u663e\u793a\u7ed9\u7528\u6237\u3002\\n\\n\u8981\u5448\u73b0\u4e0d\u540c\u7684\u952e\u76d8\uff0c\u4f8b\u5982\uff0c\u5982\u679c\u5e94\u7528\u7a0b\u5e8f\u4f7f\u7528\u7535\u5b50\u90ae\u4ef6\u4f5c\u4e3a\u7528\u6237\u540d\uff0c\u6211\u4eec\u53ef\u4ee5\u53e6\u5916\u5c06.keyboardType \u8bbe\u7f6e\u4e3a\u6240\u9700\u7684\u503c\u3002\\n\\n#### \u4e3a UIKit \u542f\u7528\u5bc6\u7801\u81ea\u52a8\u586b\u5145\\n\\nUIKit \u652f\u6301 UITextField\u3001UITextView \u548c\u4efb\u4f55\u91c7\u7528 UITextInput \u534f\u8bae\u7684\u81ea\u5b9a\u4e49\u89c6\u56fe\u4e0a\u7684\u5bc6\u7801\u81ea\u52a8\u586b\u5145\u3002\u6211\u4eec\u53ef\u4ee5\u4f7f\u7528 textContentType \u5b9e\u4f8b\u5c5e\u6027\u8bbe\u7f6e UITextContentType \u503c\uff1a\\n\\n```swift\\nuserTextField.textContentType = .username\\nuserTextField.keyboardType = .emailAddress\\npasswordTextField.textContentType = .password\\n```\\n\\n> \u539f\u6587(\u82f1\u6587)\uff1a[https://tanaschita.com/20220815-supporting-password-autofill-for-ios-appilcations](https://tanaschita.com/20220815-supporting-password-autofill-for-ios-appilcations)"},{"id":"does-apple-keep-its-commission","metadata":{"permalink":"/blog/does-apple-keep-its-commission","source":"@site/blog/2022-08-22-does-apple-keep-its-commission/index.md","title":"AppStore \u8d2d\u4e70\u6210\u529f\u540e\u9000\u6b3e\uff0c\u82f9\u679c\u662f\u5426\u4f1a\u4fdd\u7559\u4f63\u91d1\uff1f","description":"AppStore \u8d2d\u4e70\u6210\u529f\u540e\u9000\u6b3e\uff0c\u82f9\u679c\u662f\u5426\u4f1a\u4fdd\u7559\u4f63\u91d1\uff1f","date":"2022-08-22T00:00:00.000Z","formattedDate":"2022\u5e748\u670822\u65e5","tags":[{"label":"AppStore","permalink":"/blog/tags/app-store"},{"label":"\u9000\u6b3e","permalink":"/blog/tags/\u9000\u6b3e"},{"label":"\u4f63\u91d1","permalink":"/blog/tags/\u4f63\u91d1"},{"label":"iOS","permalink":"/blog/tags/i-os"}],"readingTime":2.765,"hasTruncateMarker":false,"authors":[{"name":"GoSwiftUI","title":"goswiftui.com","url":"https://goswiftui.com","imageURL":"https://goswiftui.com/img/logo.png","key":"swift"}],"frontMatter":{"slug":"does-apple-keep-its-commission","title":"AppStore \u8d2d\u4e70\u6210\u529f\u540e\u9000\u6b3e\uff0c\u82f9\u679c\u662f\u5426\u4f1a\u4fdd\u7559\u4f63\u91d1\uff1f","authors":["swift"],"tags":["AppStore","\u9000\u6b3e","\u4f63\u91d1","iOS"],"keywords":["AppStore","\u9000\u6b3e","\u4f63\u91d1"],"description":"AppStore \u8d2d\u4e70\u6210\u529f\u540e\u9000\u6b3e\uff0c\u82f9\u679c\u662f\u5426\u4f1a\u4fdd\u7559\u4f63\u91d1\uff1f"},"prevItem":{"title":"iOS \u5e94\u7528\u5b9e\u73b0\u5bc6\u7801\u81ea\u52a8\u586b\u5145","permalink":"/blog/supporting-password-autofill-for-ios-appilcations"}},"content":"\u8fd9\u91cc\u6709\u4e00\u4e2a\u6709\u8da3\u7684\u95ee\u9898\uff0c\u4f3c\u4e4e\u5b9a\u671f\u91cd\u65b0\u51fa\u73b0\uff0c\u4f46\u6ca1\u6709\u660e\u786e\u7684\u7b54\u6848\uff1a\u5728\u7528\u6237\u83b7\u5f97\u5e94\u7528\u7a0b\u5e8f\u5185\u8d2d\u4e70\u9000\u6b3e\u540e\uff0c\u82f9\u679c\u7684\u4f63\u91d1\u4f1a\u53d1\u751f\u4ec0\u4e48\uff1f\\n\\n\u6839\u636e[\u4ed8\u8d39\u5e94\u7528\u7a0b\u5e8f\u534f\u8bae](https://developer.apple.com/support/downloads/terms/schedules/Schedule-2-and-3-20220225-English.pdf)\uff0c\u5982\u679c\u5e94\u7528\u7a0b\u5e8f\u5185\u8d2d\u4e70\u9000\u6b3e\uff0c\u6240\u6709 iOS \u5f00\u53d1\u4eba\u5458\u5fc5\u987b\u540c\u610f\u4ee5\u4e0b\u653f\u7b56\uff1a\\n\\n**\u201cApple \u5c06\u6709\u6743\u4fdd\u7559\u5176\u9500\u552e\u8be5\u8bb8\u53ef\u5e94\u7528\u7a0b\u5e8f\u7684\u4f63\u91d1\uff0c\u5c3d\u7ba1\u5df2\u5c06\u4ef7\u683c\u9000\u8fd8\u7ed9\u6700\u7ec8\u7528\u6237\u3002\u201d**\\n\\n\u591a\u5e74\u6765\uff0c\u7f51\u7edc\u4e0a\u6709\u5f88\u591a\u5173\u4e8e\u8fd9\u4e2a\u95ee\u9898\u7684\u95f2\u804a\uff0c\u4ece Reddit \u548c Hacker News \u5230 Stack Overflow \u548c\u82f9\u679c\u5f00\u53d1\u4eba\u5458\u8bba\u575b\u3002\u8fd9\u662f\u6709\u9053\u7406\u7684\uff0c\u56e0\u4e3a\u4ece\u8868\u9762\u4e0a\u770b\uff0c\u8fd9\u9879\u653f\u7b56\u542c\u8d77\u6765\u5f88\u53ef\u6015\u3002\u5982\u679c Apple \u4fdd\u7559 30% \u7684\u8d2d\u4e70\u9879\u76ee\uff0c\u5e76\u968f\u540e\u9000\u6b3e\uff0c\u5f00\u53d1\u8005\u53ef\u80fd\u4f1a\u635f\u5931\u5f88\u591a\u94b1\u3002\\n\\n\u4f8b\u5982\uff0c\u5047\u8bbe\u60a8\u62e5\u6709\u4e00\u4e2a\u5065\u8eab\u5e94\u7528\u7a0b\u5e8f\uff0c\u5e76\u4e14\u60a8\u7684\u4e00\u4e2a\u7528\u6237\u4e3a\u60a8\u7684 100 \u7f8e\u5143\u5e74\u5ea6\u8ba1\u5212\u8d2d\u4e70\u4e86\u8ba2\u9605\u3002\u4f60\u4ed8\u7ed9\u82f9\u679c 30 \u7f8e\u5143\uff0c\u53ef\u4ee5\u4fdd\u7559 70 \u7f8e\u5143\u3002\u4f46\u662f\uff0c\u5982\u679c\u7528\u6237\u4e3a\u4ed6\u4eec\u7684\u8d2d\u4e70\u9000\u6b3e\uff0c\u4ed6\u4eec\u5c06\u83b7\u5f97 100 \u7f8e\u5143\u7684\u9000\u6b3e\uff0c\u5982\u679c\u82f9\u679c\u6709\u6743\u4fdd\u7559 30%\u7684\u4f63\u91d1\uff0c\u60a8\u5c06\u83b7\u5f97 30 \u7f8e\u5143\u3002\u53ef\u4ee5\u7406\u89e3\uff0c\u8fd9\u8ba9\u8bb8\u591a\u5f00\u53d1\u4eba\u5458\u611f\u5230\u62c5\u5fe7\u3002\\n\\n\u7531\u4e8e\u56f4\u7ed5\u8fd9\u4e2a\u8bdd\u9898\u7684\u4e0d\u786e\u5b9a\u6027\uff0c\u6211\u51b3\u5b9a\u901a\u8fc7\u4ece\u6211\u7684 App Store Connect \u5e10\u6237\u4e2d\u63d0\u53d6\u8be6\u7ec6\u7684\u4ed8\u6b3e\u62a5\u544a\u6765\u6d4b\u8bd5\u5b83\uff1a\\n\\n![img](./Screen-Shot-2022-08-16-at-11.59.49-AM.webp)\\n\\n\u5982\u60a8\u6240\u89c1\uff0c\u82f9\u679c\u5728\u5411\u7528\u6237\u53d1\u653e\u9000\u6b3e\u65f6\u6263\u9664\u4e86\u4f63\u91d1*\u540e*\u4ef7\u683c\uff08\u6807\u6709\u201c\u6269\u5c55\u5408\u4f5c\u4f19\u4f34\u4efd\u989d\u201d\u7684\u5217\uff09\u3002\u56e0\u6b64\uff0c\u82f9\u679c\u6ca1\u6709\u4fdd\u7559\u5176 30%\u7684\u4f63\u91d1\uff0c\u6211\u4e5f\u6ca1\u6709\u635f\u5931\u4efb\u4f55\u94b1\u3002\\n\\n\u5e95\u7ebf\uff1f\u82f9\u679c*\u4fdd\u7559*\u4fdd\u7559\u4f63\u91d1\u91d1\u989d\u7684\u6743\u5229\uff0c\u4f46\u8fd9\u5e76\u4e0d\u610f\u5473\u7740*\u4f1a\u7684*\u3002\u6211\u6000\u7591 Apple \u5728\u6b3a\u8bc8\u6216\u5176\u4ed6\u60c5\u6709\u53ef\u539f\u60c5\u51b5\u7684\u6761\u6b3e\u548c\u6761\u4ef6\u4e2d\u5305\u542b\u6b64\u5185\u5bb9\u3002\\n\\n\u6240\u4ee5\uff0c\u4f60\u62e5\u6709\u5b83\uff01\\n\\n\u867d\u7136\u4ece\u6280\u672f\u4e0a\u8bb2\uff0c\u5373\u4f7f\u5728\u8d2d\u4e70\u9000\u6b3e\u540e\uff0c\u82f9\u679c\u4e5f\u6709\u6743\u4fdd\u7559\u5176\u4f63\u91d1\uff0c\u4f46\u6211\u8fd8\u6ca1\u6709\u542c\u5230\u4efb\u4f55\u786e\u8bca\u6848\u4f8b\u3002\u53ea\u8981\u60a8\u5408\u6cd5\u548c\u4e13\u4e1a\u5730\u8fd0\u8425\u60a8\u7684\u5e94\u7528\u7a0b\u5e8f\u4e1a\u52a1\uff0c\u60a8\u5c31\u4e0d\u5e94\u8be5\u6709\u4efb\u4f55\u53ef\u62c5\u5fc3\u7684\u4e8b\u60c5\u3002\\n\\n> \u539f\u6587(\u82f1\u6587)\uff1a[https://www.revenuecat.com/blog/does-apple-keep-its-commission/](https://www.revenuecat.com/blog/does-apple-keep-its-commission/)"}]}')}}]);